-- ----------------------------
-- Table structure for `fly_user`
-- ----------------------------
DROP TABLE IF EXISTS `fly_user`;
CREATE TABLE `fly_user` (
  `user_id` bigint(20) unsigned NOT NULL COMMENT '用户ID',
  `short_url` varchar(100) DEFAULT NULL,
  `user_name` varchar(50) DEFAULT NULL COMMENT '用户名',
  `user_mobile` varchar(20) DEFAULT NULL COMMENT '手机',
  `user_email` varchar(255) DEFAULT NULL COMMENT 'Email',
  `password` varchar(100) NOT NULL COMMENT '密码',
  `nick_name` varchar(100) DEFAULT NULL,
  `true_name` varchar(50) DEFAULT NULL COMMENT '真实姓名',
  `sex` tinyint(1) NOT NULL DEFAULT '1' COMMENT '性别1男2女3保密',
  `avatar` varchar(255) DEFAULT NULL,
  `work` varchar(100) DEFAULT NULL COMMENT '目前工作职位',
  `signature` varchar(100) DEFAULT NULL COMMENT '个性签名',
  `description` text COMMENT '自我介绍',
  `telephone` varchar(50) DEFAULT NULL COMMENT '联系电话',
  `province` int(11) DEFAULT NULL,
  `city` int(11) DEFAULT NULL,
  `area` int(11) DEFAULT NULL,
  `contact_addr` varchar(250) DEFAULT NULL COMMENT '联系地址',
  `zip` varchar(10) DEFAULT NULL COMMENT '邮政编码',
  `qq` varchar(15) DEFAULT NULL COMMENT 'QQ',
  `birthday` datetime DEFAULT NULL COMMENT '生日',
  `custom` varchar(255) DEFAULT NULL COMMENT '用户习惯方式,配送和支付方式等信息',
  `last_login` datetime DEFAULT NULL COMMENT '最后一次登录时间',
  `login_ip` varchar(20) DEFAULT NULL COMMENT '登录的ip地址',
  `attempts` int(11) DEFAULT '0' COMMENT '尝试登录，未登录成功次数',
  `attempts_time` datetime DEFAULT NULL COMMENT '最后尝试登陆未成功时间',
  `create_time` datetime DEFAULT NULL COMMENT '注册日期时间',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '用户状态 1正常状态 2 删除至回收站 3锁定',
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户信息表';

